Millennium: Week 2. &quot;Toys in the Attic!&quot; John Byrne gives one of the Man of Steel's oldest enemies an upgrade in this Millennium tie-in issue. The Toyman has never been this dangerous before. Plus, Lana Lang...a Manhunter? Say it isn't so. It's a mystery that leads Superman back to where it all began...back to Smallville. Story continues in Adventures of Superman #436, Action Comics #596, and Millennium #2.

